defineService({name:"System Watchdog",tickInterval:1e4,onStart:async e=>{e.state.startTime=Date.now(),e.state.checks=0,Neo.log.info("Watchdog service started")},onStop:async e=>{const t=Math.floor((Date.now()-e.state.startTime)/1e3);Neo.log.info("Watchdog stopped - uptime: "+t+"s, checks: "+e.state.checks)},onTick:async e=>{e.state.checks+=1;const t=Math.floor((Date.now()-e.state.startTime)/1e3);Neo.log.debug("Watchdog check #"+e.state.checks+" - uptime: "+t+"s")}});
